import React from 'react';
import './css/UI.css';

function Head(){
  var name="Antony Otieno";
  var xp=1200;
    return(
      <div className="Head Card">
      <br></br>
      <div className="img"></div>
      <div className="user">
      {name} <br></br> {xp} xp
      </div>
      <br className="clear"></br>
      <span className="days">M</span> <span className="days">T</span> <span className="days">W</span> <span className="days">Th</span> <span className="days">F</span> <span className="days">S</span> <span className="days">S</span>
      </div>
  );
}
export default Head;
